import React, { useEffect } from 'react';

function Table(probs) {
  return (
    <div id="new_contact">
      <table>
        <tr>
          <th><h4 id="create_name">Type</h4></th>
          <th><h4 id="number">Number</h4></th>
        </tr>
        <tr>
          <th>{probs.type}</th>
          <th>{probs.number}</th>
          <th><button id = "dl3" class = "button2">Delete</button></th>
        </tr>


      </table>

    </div>
  );
}

export default Table;
